    false,nt"url": null,nt"notes": "This data contains the case counts for
    birth defects among Iowa births.The birth defects covered are anencephaly, spina
    bifida without anencephaly, hypoplastic left heart syndrome, tetralogy of fallot,
    transposition of great arteries, cleft lip with or w/o cleft palate, cleft palate
    w/o cleft lip, hypospadias, gastroschisis, upper limb deficiencies, lower limb deficiencies,
    and trisomy 21. Stratification of the data are available by type of defect, maternal
    age-group, maternal race/ethnicity and infant sex.  This dataset contains confidential
    information. All data has been aggregated to five year measures. Small numbers suppression
    has been applied to data available.",nt"license_title": "License Not Specified",nt"extras":
